import React from "react";
import { Route, Switch } from "react-router-dom";
import Add from "./Add";
import List from "./List";
import Navbar from "./Navbar";

function App(){

    return (
        <div>
            <Navbar />
            <Switch>
                <Route component={List} exact path="/" />
                <Route component={Add} path="/add" />
            </Switch>
        </div>
    )
}

export default App;
